import axios from 'axios';

var address = "http://localhost:8888/";

function filterNull(o) {
    // ...（保持不变）
}

function apiAxios(type, url, params, callback) {
    if (type == 'GET') {
        // ...（保持不变）
    }

    if (type == 'POST') {
        axios.post(address + url, params) // 直接传递 params
            .then(response => {
                callback(response.data);
            })
            .catch(error => {
                console.error('There was an error for post!', error);
            });
    }
}

export default {
    get: function (url, params, callback) {
        return apiAxios('GET', url, params, callback);
    },
    post: function (url, params, callback) {
        return apiAxios('POST', url, params, callback);
    }
}
